import React from 'react';
import { Pagination, PaginationItem, PaginationLink } from 'reactstrap';

export class Paginate extends React.Component {

  render() {
    const PRIV_KEY = "ce1693d8baa06f879abcab4c75c19e34006074db";
    const PUBLIC_KEY = "1415ee478404a80e6f620f034e526ca0";
    const ts = new Date().getTime();


    const hash = CryptoJS.MD5(ts + PRIV_KEY + PUBLIC_KEY).toString();

    return (
      <Pagination aria-label="Page navigation example">
        <PaginationItem>
          <PaginationLink href={`http://gateway.marvel.com/v1/public/characters?ts=${ts}&offset=0&limit=8&apikey=${PUBLIC_KEY}&hash=${hash}`}>1</PaginationLink>
        </PaginationItem>
        <PaginationItem>
          <PaginationLink href={`http://gateway.marvel.com/v1/public/characters?ts=${ts}&offset=8&limit=16&apikey=${PUBLIC_KEY}&hash=${hash}`}>2</PaginationLink>
        </PaginationItem>
        <PaginationItem>
          <PaginationLink href={`http://gateway.marvel.com/v1/public/characters?ts=${ts}&offset=16&limit=24&apikey=${PUBLIC_KEY}&hash=${hash}`}>3</PaginationLink>
        </PaginationItem>
        <PaginationItem>
          <PaginationLink href={`http://gateway.marvel.com/v1/public/characters?ts=${ts}&offset=24&limit=32&apikey=${PUBLIC_KEY}&hash=${hash}`}>4</PaginationLink>
        </PaginationItem>
        <PaginationItem>
          <PaginationLink href="#">
            5
          </PaginationLink>
        </PaginationItem>
      </Pagination>
    );
  }
}
export default Paginate;
